import React from "react";
import n from "./New.module.css";
import * as axios from "axios";
import userPhoto from "../../image/down2.jpg";

const Users = (props) => {
  let aysman = () => {
    if (props.users.length === 0) {
      axios
        .get("https://social-network.samuraijs.com/api/1.0/users")
        .then((response) => {
          props.setusers(response.data.items);
        });
    }
  };

  return (
    <div className={n.item}>
      <button onClick={aysman}>bac</button>
      {props.users.map((b) => {
        return (
          <div key={b.id}>
            <img src={b.photos.small != null ? b.photos.small : userPhoto} />
            <p>{b.name}</p>
            <p>{b.status}</p>
            <p>{"b.location.city"}</p>
            <p>{"b.location.country"}</p>
            {b.followed ? (
              <button onClick={() => props.unfolow(b.id)}>unfolow</button>
            ) : (
              <button onClick={() => props.folow(b.id)}>follow</button>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default Users;
